// This function maps tokens to integer indexes
let tagOfToken (t:token) = 
  match t with
  | BAR  -> 0 
  | PERCENT_PERCENT  -> 1 
  | START  -> 2 
  | LEFT  -> 3 
  | RIGHT  -> 4 
  | NONASSOC  -> 5 
  | LESS  -> 6 
  | GREATER  -> 7 
  | COLON  -> 8 
  | PREC  -> 9 
  | SEMI  -> 10 
  | EOF  -> 11 
  | ERROR  -> 12 
  | HEADER _ -> 13 
  | CODE _ -> 14 
  | TOKEN _ -> 15 
  | IDENT _ -> 16 
  | TYPE _ -> 17 

// This function maps integer indexes to symbolic token ids
let tokenTagToTokenId (tokenIdx:int) = 
  match tokenIdx with
  | 0 -> TOKEN_BAR 
  | 1 -> TOKEN_PERCENT_PERCENT 
  | 2 -> TOKEN_START 
  | 3 -> TOKEN_LEFT 
  | 4 -> TOKEN_RIGHT 
  | 5 -> TOKEN_NONASSOC 
  | 6 -> TOKEN_LESS 
  | 7 -> TOKEN_GREATER 
  | 8 -> TOKEN_COLON 
  | 9 -> TOKEN_PREC 
  | 10 -> TOKEN_SEMI 
  | 11 -> TOKEN_EOF 
  | 12 -> TOKEN_ERROR 
  | 13 -> TOKEN_HEADER 
  | 14 -> TOKEN_CODE 
  | 15 -> TOKEN_TOKEN 
  | 16 -> TOKEN_IDENT 
  | 17 -> TOKEN_TYPE 
  | 20 -> TOKEN_end_of_input
  | 18 -> TOKEN_error
  | _ -> failwith "tokenTagToTokenId: bad token"

